import React, { Component } from 'react';
import "./index.css";

function App() {
  return (
    <div className="banner">
      <div className="bannerShape">
      <iframe src="https://dlutz.ca/index.html" width="100%" frameBorder="0" overflow="hidden" scrolling="no" cellspacing="0">
    </iframe>
    </div>
</div>
  );
}

export default App;
